  `STAFF_ID` bigint(12) NOT NULL,
  `NOTES` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`RES_ID`),
  KEY `FK_FK_BOOK_RES_BOOK_ID` (`BOOK_ID`),
