/*Table structure for table `vw_fhres` */

DROP TABLE IF EXISTS `vw_fhres`;

/*!50001 DROP VIEW IF EXISTS `vw_fhres` */;
/*!50001 DROP TABLE IF EXISTS `vw_fhres` */;

/*!50001 CREATE TABLE  `vw_fhres`(
 `BOOK_NAME` varchar(255) NULL ,
 `BOOK_NO` varchar(60) NULL ,
 `page_num` int(10) NULL ,
 `RES_ID` bigint(12) NULL  default '0' ,
 `BOOK_ID` bigint(12) NULL ,
 `NAME` varchar(60) NULL ,
 `FORMAT` bigint(12) NULL ,
 `PARENT_RES_ID` bigint(12) NULL ,
 `IP_ADDR` varchar(15) NULL ,
 `CATA_ADDR` varchar(255) NULL ,
 `ALL_ADDR_IN_NET` text NULL ,
 `ALL_ADDR_OUT_NET` text NULL ,
 `IS_UPLOAD` tinyint(1) NULL ,
 `CREATE_TIME` datetime NULL ,
 `UPDATE_TIME` datetime NULL ,
 `DELETE_STATE` tinyint(1) NULL ,
 `IS_AUDIT` tinyint(1) NULL ,
 `AUDIT_STAFF_ID` bigint(12) NULL ,
 `STAFF_ID` bigint(12) NULL ,
 `NOTES` varchar(255) NULL 
)*/;

/*View structure for view vw_fhres */

/*!50001 DROP TABLE IF EXISTS `vw_fhres` */;
/*!50001 DROP VIEW IF EXISTS `vw_fhres` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` SQL SECURITY DEFINER VIEW `vw_fhres` AS (select distinct `b`.`NAME` AS `BOOK_NAME`,`b`.`BOOK_NO` AS `BOOK_NO`,`a`.`PAGE_NUM` AS `page_num`,`c`.`RES_ID` AS `RES_ID`,`c`.`BOOK_ID` AS `BOOK_ID`,`c`.`NAME` AS `NAME`,`c`.`FORMAT` AS `FORMAT`,`c`.`PARENT_RES_ID` AS `PARENT_RES_ID`,`c`.`IP_ADDR` AS `IP_ADDR`,`c`.`CATA_ADDR` AS `CATA_ADDR`,`c`.`ALL_ADDR_IN_NET` AS `ALL_ADDR_IN_NET`,`c`.`ALL_ADDR_OUT_NET` AS `ALL_ADDR_OUT_NET`,`c`.`IS_UPLOAD` AS `IS_UPLOAD`,`c`.`CREATE_TIME` AS `CREATE_TIME`,`c`.`UPDATE_TIME` AS `UPDATE_TIME`,`c`.`DELETE_STATE` AS `DELETE_STATE`,`c`.`IS_AUDIT` AS `IS_AUDIT`,`c`.`AUDIT_STAFF_ID` AS `AUDIT_STAFF_ID`,`c`.`STAFF_ID` AS `STAFF_ID`,`c`.`NOTES` AS `NOTES` from ((`r_book_page_res` `a` left join `r_book` `b` on((`b`.`BOOK_ID` = `a`.`BOOK_ID`))) left join `r_book_res` `c` on((`c`.`RES_ID` = `a`.`RES_ID`))) where (`b`.`ORG_ID` in (1,2))) */;

